	add("moon", "{\"term\":\"moon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"northern frisian\", \"West Frisian\", \"Icelandic\", \"Latin\", \"Dutch\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|mone}}, from Old english (ca. 450-1100) {{m|ang|mōna||moon}}, from Proto-germanic {{m|gem-pro|*mēnô||moon}}, from Proto-indo-european {{m|ine-pro|*mḗh₁n̥s||moon, month}}, probably from {{m|ine-pro|*meh₁-||to measure}}. Cognate with Scots {{m|sco|mone}}, {{m|sco|mune||moone}}, Northern frisian {{m|frr|muun||moon}}, West frisian {{m|fy|moanne||moon}}, Dutch {{m|nl|maan||moon}}, German {{m|de|Mond||moon}}, Swedish {{m|sv|måne||moon}}, Icelandic {{m|is|máni||moon}}, Latin {{m|la|mēnsis||month}}. See also {{m|en|month}}, a related term within Indo-European.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The largest satellite of Earth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any natural satellite of a planet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A month, particularly a lunar month\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A crescent-like outwork in a fortification\", \"priority\":4}]}, \"synonyms\":{}}");

	add("moon", "{\"term\":\"moon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|mōna}}, from Proto-germanic {{m|gem-pro|*mēnô}}, from Proto-indo-european {{m|ine-pro|*mḗh₁n̥s||moon, month}}, from {{m|ine-pro|*mē-\u0026amp;sup2;||to measure}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Earth\u0027s moon; the sole natural satellite of the Earth, represented in astronomy and astrology by ☾\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The god of the Moon in Heathenry\", \"priority\":2}]}, \"synonyms\":{}}");

	add("moocher", "{\"term\":\"moocher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mooch|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person having a tendency to repeatedly ask help of others, especially if they are making little effort to help themselves. Usually used as a pejorative\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, The Economist, September 22nd, \u0027[http://www.economist.com/node/21563298 CNN’s woes: Unbiased and unloved\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When w:Mitt Mitt Romney says that 47% of Americans are \u0027\u0027moochers\u0027\u0027, or Barack Obama says that entrepreneurs didn’t build their own businesses, partisan viewers crave a partisan response\", \"priority\":3}]}, \"synonyms\":{}}");

	add("mooer", "{\"term\":\"mooer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|moo|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who moos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970,\u0027\u0027 Reginald Horace Blyth, \u0027[http://books.google.com/books?id\u003dsgQYAAAAIAAJ\u0026amp;q\u003dmooer,+cow\u0026amp;dq\u003dmooer,+cow\u0026amp;lr\u003d\u0026amp;as_brr\u003d0 Zen and Zen Classics - Page 164\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rinzai says, \u0026quot;I can do more than moo; I can call you a \u0027\u0027mooer\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993,\u0027\u0027 Jonathan Rix, \u0027[http://books.google.com/books?id\u003dA01bAAAAMAAJ\u0026amp;q\u003dmooer,+cow\u0026amp;dq\u003dmooer,+cow\u0026amp;lr\u003d\u0026amp;as_brr\u003d0 Some Hope - Page 66\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"and just as I\u0027ve finished my first glass this snooty cow comes over\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Then like Si appears and I reckon he saw this \u0027\u0027mooer\u0027\u0027 was getting my goat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008,\u0027\u0027 Peggy McColl, \u0027[http://books.google.com/books?id\u003dKa3PBZwStf8C\u0026amp;pg\u003dPA67\u0026amp;dq\u003dmooer,+cow\u0026amp;lr\u003d\u0026amp;as_brr\u003d0\u0026amp;sig\u003dACfU3U3WStkFxvKqjxrIGyGlu_WF_PT5tg 21 Distinctions of Wealth: Attract the Abundance You Deserve - Page 67\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Her husband, as it turned out, was an amazing \u0027\u0027mooer\u0027\u0027, and he mooed his way to winning\", \"priority\":8}]}, \"synonyms\":{}}");

	add("moola", "{\"term\":\"moola\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\", \"Irish\", \"romany\", \"Sanskrit\"], \"text\":\"{{unk.|lang\u003den}}. Suggested origins include:* from Romany lt;ref\u0026gt;Henry Hitchings, \u0027The Secret Life of Words: How English Became English\u0027 (ISBN 0374254109), page 323\u0026lt;/ref\u0026gt; {{m|rom|mol||have value, be worth}}* from Irish {{m|ga||moll óir|heap of gold}}\u0026lt;ref\u0026gt;Daniel Cassidy, \u0027The Secret Language of the Crossroads: How the Irish Invented Slang\u0027\u0026lt;/ref\u0026gt; However, this is unlikely because of the difference in pronunciation.* from French from Sanskrit {{m|sa|मूल||capital, principal}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"money, cash\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mooli", "{\"term\":\"mooli\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\", \"Sanskrit\"], \"text\":\"From Hindi मूली (\u0027mūlī\u0027, \u0026quot;[Indian] radish\u0026quot;), from Sanskrit \u0027mūlikā\u0027 (\u0026quot;root\u0026quot;), from \u0027mūla, mūlaka\u0027 (\u0026quot;root\u0026quot;).\u0026lt;ref\u0026gt;\u0027Oxford English Dictionary\u0027, 3rd\u0026amp;nbsp;ed. \u0026quot;mooli, \u0027n.\u0027\u0026quot; Oxford University Press (Oxford), 2002.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"particularly its Indian varieties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1868\u0027\u0027, B.H. Powell, \u0027Handbk. Econ. Products Punjab\u0027, I. iii. 260\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fresh vegetables... most in use among natives are—Gájar, carrot... \u0027\u0027Múlí\u0027\u0027, radish (\u0027Raphanus sativus\u0027, L\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1981 February 1\u0027\u0027, \u0027N.Y. Times\u0027, 17\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Particularly delicious was \u0027\u0027mooli\u0027\u0027 stuffed paratha—rich, flaky and filled with a fragrant grated radish mixture\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996 February 4\u0027\u0027, \u0027Sunday Telegraph\u0027, 33\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This is thanks to the introduction of a wider range of radish varieties into supermarkets, especially the long-rooted ‘\u0027\u0027mooli\u0027\u0027’ types from Japan\", \"priority\":7}]}, \"synonyms\":{}}");

