	add("mooncalf", "{\"term\":\"mooncalf\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|moon|calf|lang\u003den}}, after a superstition that the moon caused abnormal fetal developement.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abnormal mass within the uterus; a false conception\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027s:The The Tempest\u0027, by w:William Shakespeare, act 2 scene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thou art very Trinculo indeed! How cam\u0027st thou / to be the siege of this \u0027\u0027moon-calf\u0027\u0027? Can he vent Trinculos\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A poorly-conceived idea or plan\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A dreamer, someone absent-minded or distracted; a fool, simpleton\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, w:John Kendrick John Kendrick Bangs, \u0027Olympian Nights\u0027, ch. 10\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;[Y]ou\u0027re a jobbernowl and a doodle, a maundering \u0027\u0027mooncalf\u0027\u0027 and a blockheaded numps, a gaby and a loon; you\u0027re a \u0027Hatter\u0027!\u0026quot; I shrieked the last epithet\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"w:Ogden Ogden Nash, \u0026quot;Come On In, The Senility Is Fine\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"But I can think of no one but a \u0027\u0027mooncalf\u0027\u0027 or a gab\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Who would trust their own child to raise a baby\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 (\u0027Avignon Quintet\u0027), p. 463\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"He slipped it softly onto her unresisting finger and, like the unwise \u0027\u0027moncalf\u0027\u0027 he was, kissed it\", \"priority\":12}]}, \"synonyms\":{}}");

