	add("moonglade", "{\"term\":\"moonglade\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|moon|glade|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bright reflection of moonlight on a body of water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Heaven was full of silent stars, and there was a \u0027\u0027moonglade\u0027\u0027 on the water that stretched almost from him to Rose.\u0027 \u0026amp;mdash; Edgar Rice Burroughs, \u0027The Efficiency Expert\u0027, 192\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The sea shimmered there, and turned, at last, into a \u0027\u0027moonglade\u0027\u0027, through which she glided handsomely.\u0027 \u0026amp;mdash; Edmund Gilligan, \u0027Voyage of the Golden Hind\u0027, 194\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the new moon, descending, gave her a \u0027\u0027moonglade\u0027\u0027 down which she sailed until moonset and plunged on into the darkness,\u0027 \u0026amp;mdash; Edmund Gilligan, \u0027I Name Thee Mara\u0027, New York: Charles Scribner\u0027s Sons, 1946\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a double \u0027\u0027moonglade\u0027\u0027 on the Auroral Ocean ...\u0027 \u0026amp;mdash; Paul Anderson, \u0027Mirkieim\u0027, 1977\", \"priority\":5}]}, \"synonyms\":{}}");

