	add("moonrat", "{\"term\":\"moonrat\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Malay\"], \"text\":\"From {{compound|moon|rat|lang\u003den}}, a calque of Malay \u0027tikus balan\u0027 (\u0027tikus\u0027 (rat) + \u0027bulan\u0027 (moon) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gymnure, especially the\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Andrew Grieser Johns, \u0027Timber Production and Biodiversity Conservation in Tropical Rain Forests\u0027, [http://books.google.com.au/books?id\u003dcjPKp_CdM1IC\u0026amp;pg\u003dPA87\u0026amp;dq\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d791UUpvAOsGBiQfSpICYBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;f\u003dfalse page 87\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Incidental observations on \u0027\u0027moonrats\u0027\u0027 \u0027Echinosorex gymnurus\u0027 in Malaysia suggests that this species is uncommon everywhere but does occur in low numbers in logged\u0026lt;sup\u0026gt;(1-12:51)\u0026lt;/sup\u0026gt; forest in peninsular Malaysia (Johns 1989a\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Fred Cooke, \u0027The Encyclopedia of Animals: A Complete Visual Guide\u0027, [http://books.google.com.au/books?id\u003d2V1tHqi4hLEC\u0026amp;pg\u003dPA86\u0026amp;dq\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d791UUpvAOsGBiQfSpICYBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;f\u003dfalse page 86\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The smell of rotting onions, stale sweat, or ammonia may indicate the presence of a \u0027\u0027moonrat\u0027\u0027, which produces a strong scent from two glands near the anus. The animal uses this powerful odor to mark its territory. A solitary creature, the \u0027\u0027moonrat\u0027\u0027 will emit hiss-puffs and low roars if it encounters another member of its species\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, E. Meijaard (editor), \u0027Life After Logging\u0027, [http://books.google.com.au/books?id\u003dyxxhq3EGYukC\u0026amp;pg\u003dPA82\u0026amp;dq\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d791UUpvAOsGBiQfSpICYBw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22moonrat%22%7C%22moonrats%22\u0026amp;f\u003dfalse page 82\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Moonrats\u0027\u0027 are a lowland forest species which feed primarily on worms and arthropods\", \"priority\":10}]}, \"synonyms\":{}}");

