	add("moonshine", "{\"term\":\"moonshine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The light of the moon; moonlight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Illegally distilled liquor, so named because much of the manufacturing process is often conducted without artificial light at night when the moon is shining\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They watered down the \u0027\u0027moonshine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter I\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Wish I\u0027d been more polite to that girl,” the sheriff remarked regretfully. “ I ain\u0027t had a bite to eat since four o\u0027clock this morning, and I\u0027m hungry as a wolverine. … I know she\u0027d have give me another drink of that old \u0027\u0027moonshine\u0027\u0027 she has\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"nonsens\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was talking \u0027\u0027moonshine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"w:David David Attenborough, 2012 interview.\u0026lt;ref\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"quot;We forget what we have learned in the last 60 years. At university I once asked one of my lecturers why he was not talking to us about continental drift and I was told, sneeringly, that if I could I prove there was a force that could move continents, then he might think about it. The idea was \u0027\u0027moonshine\u0027\u0027, I was informed.\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A branch of pure mathematics relating the monster group to an invariant of elliptic functions; see\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A spiced dish of eggs and fried onions\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A month\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Wherefore should I / Stand in the plague of custom and permit / The curiosity of nations to deprive me / For that I am some twelve or fourteen \u0027\u0027moonshines\u0027\u0027 / Lag of a brother\", \"priority\":14}]}, \"synonyms\":{}}");

