	add("moonwake", "{\"term\":\"moonwake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|moon|wake|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The reflection of moonlight on a body of water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I was long puzzled to know why this \u0027\u0027moonwake\u0027\u0027 always followed as I walked ...\u0027 \u0026amp;mdash; Daniel A. Goodsell, \u0027Nature and Character at Granite Bay\u0027, 190\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And they grew and brightened and gathered; and whiles together they ran. Like the \u0027\u0027moonwake\u0027\u0027 over the waters; and whiles they were scant and wan, ...\u0027 \u0026amp;mdash; William Morris, \u0027The Story of Sigurd the Volsung\u0027, 192\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mariners sometimes call the moving path of light leading to the moon the \u0027\u0027\u0027moonwake\u0027\u0027\u0027, because it looks like the white wash of a ship\u0027s wake.\u0027 \u0026amp;mdash; The Atlantic, \u0027Word Fugitives\u0027, March, 2006\", \"priority\":4}]}, \"synonyms\":{}}");

